import React from "react";
import { Link } from "react-router-dom";

function Logout(props) {
  return (
    <Link to="/" onClick={props.onLogout}>
      Logout
      <div
        class="dropdown-menu dropdown-menu-right"
        aria-labelledby="userDropdown"
      ></div>
    </Link>
  );
}

export default Logout;
